    false,nt"url": null,nt"notes": "Experimental forecast model product from
    the USGS Coupled Ocean Atmosphere Wave Sediment-Transport (COAWST) modeling system.
    Data required to drive the modeling system include parametric wave parameters derived
    from Wave Watch III, wind and atmospheric surface inputs derived from the National
    Centers for Environmental Prediction (NCEP) North American Mesoscale and Global
    Forecasting System models, and climatology fields obtained from the Florida State
    University Center for Ocean-Atmospheric Predictions Studies (COAPS)  HYCOM model.
    The COAWST model above is run on a 5km (336x896) grid which encompasses the US East
    Coast and the Gulf of Mexico.",nt"license_title": null,nt"extras": [{ntt"key":
